let transitionReference = {};

const loopCheck = (beforeName, selectionSet) => {
  if (!selectionSet) {
    return;
  }

  // FIXME author -> books -> shops -> authors -> books -> shops
  // author -> books -> shops -> countrys -> authors -> shops -> books -> shops
  //
  // How should I decide loop cancel rule?
  //

  // ! Object.keys()

  if (beforeName && selectionSet.selections[0].name.value) {
    if (!transitionReference[beforeName]) {
      transitionReference[beforeName] = [];
    }
    if (!transitionReference[beforeName].includes(selectionSet.selections[0].name.value)) {
      transitionReference[beforeName].push(selectionSet.selections[0].name.value);
    } else {
      console.log(`${beforeName} -> ${selectionSet.selections[0].name.value} is already exist pattern at ${JSON.stringify(transitionReference)}`);
    }
  }

  if (selectionSet.selections[0].selectionSet) {
    if (!transitionReference[selectionSet.selections[0].name.value]) {
      transitionReference[selectionSet.selections[0].name.value] = [];
    }
    if (!transitionReference[selectionSet.selections[0].name.value].includes(selectionSet.selections[0].selectionSet?.selections[0].name.value)) {
      transitionReference[selectionSet.selections[0].name.value].push(selectionSet.selections[0].selectionSet?.selections[0].name.value);
    } else {
      console.log(`${selectionSet.selections[0].name.value} -> ${selectionSet.selections[0].selectionSet?.selections[0].name.value} is already exist pattern at ${JSON.stringify(transitionReference)}`);
    }
  }

  if (beforeName === selectionSet.selections[0].selectionSet?.selections[0].name.value) {
    console.log("loop!");
    console.log(`beforeName: ${beforeName}, nowName: ${selectionSet.selections[0].name.value}, nextName: ${selectionSet.selections[0].selectionSet?.selections[0].name.value}`);
  }
  return loopCheck(selectionSet.selections[0].name.value, selectionSet.selections[0].selectionSet);
}

